import React from "react";

const Header = () => {
  return (
    <header>
      <div className='logo'>
        <span>REACT THREE FIBER</span>
      </div>
      <div className='episode'>
        <span>EP. 1</span>
      </div>
    </header>
  );
};

export default Header;
